import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be visible and click to focus
    await page.waitForSelector('#eventSearchInput');
    await page.click('#eventSearchInput');

    // Take screenshot after focusing on the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_focused_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_focused_search_input.png'));

    return {
      success: true,
      action: "Focused on the search input field",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be visible and focused
    const searchInputSelector = '#eventSearchInput';
    await page.waitForSelector(searchInputSelector, { visible: true });

    // Click on the search input field to focus it
    await page.click(searchInputSelector);

    // Take screenshot after focusing on the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_focused_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_focused_search_input.png'));

    // Verify if the search input is focused
    const isFocused = await page.evaluate(selector => {
      const input = document.querySelector(selector);
      return document.activeElement === input;
    }, searchInputSelector);

    return {
      success: true,
      action: "Focused on the search input field",
      extractedData: { isFocused },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

